using System;
using System.Collections.Generic;
using System.Text;
using System.Windows.Input;
using BuildHappiness.Core.Models;
using Xamarin.Forms;

namespace BuildHappinessAdmin.ViewModels
{
    public class SPRequestPageViewModel : ViewModelBase
    {
        public ICommand ApproveCommand { get; set; }
        public ICommand DeclineCommand { get; set; }
        public ICommand RefreshCommand { get; set; }

        private bool isRefreshing;

        public bool IsRefreshing
        {
            get => isRefreshing;
            set
            {
                if (isRefreshing != value)
                {
                    isRefreshing = value;

                    NotifyPropertyChanged();
                }
            }
        }

        private bool hasNoData;

        public bool HasNoData
        {
            get => hasNoData;
            set
            {
                if (hasNoData != value)
                {
                    hasNoData = value;

                    NotifyPropertyChanged();
                }
            }
        }

        private List<ServiceProvider> requests;

        public List<ServiceProvider> Requests
        {
            get => requests;
            set
            {
                if(requests != value)
                {
                    requests = value;
                    HasNoData = requests == null || requests.Count == 0;

                    NotifyPropertyChanged();
                }
            }
        }

        public SPRequestPageViewModel()
        {
            FetchData();

            ApproveCommand = new Command(Approve);
            DeclineCommand = new Command(Decline);
            RefreshCommand = new Command(Refresh);
        }

        private async void Approve(object obj)
        {
            if(obj is ServiceProvider)
            {
                ((ServiceProvider)obj).Status = "Approved";

                await DataService.ApproveServiceProvider((ServiceProvider)obj);

                Refresh(null);
            }
        }

        private async void Refresh(object obj)
        {
            IsRefreshing = true;
            Requests = await DataService.GetPendingServiceProviderRequest();
            IsRefreshing = false;
        }
        
        private async void Decline(object obj)
        {
            if (obj is ServiceProvider)
            {
                ((ServiceProvider)obj).Status = "Decline";

                await DataService.DeclineServiceProvider((ServiceProvider)obj);

                Refresh(null);
            }
        }

